import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import classnames from 'classnames';
import { withRouter } from 'react-router';
import ReactDrawer from 'react-drawer';
import 'react-drawer/lib/react-drawer.css';
import {
  Container,
  Form,
  Modal,
  ModalBody,
  Dropdown,
  DropdownMenu,
  DropdownToggle,
} from 'reactstrap';

//Import Icons
import FeatherIcon from 'feather-icons-react';

//Import images
import logodark from '../../assets/images/logo-dark.png';
import logolight from '../../assets/images/logo-light.png';
import shop1 from '../../assets/images/shop/product/s-1.jpg';
import shop2 from '../../assets/images/shop/product/s-2.jpg';
import shop3 from '../../assets/images/shop/product/s-3.jpg';

import NavbarButtons from '../Shared/NavbarButtons';
import appStore from '../../assets/images/app/app-store.png';
import playStore from '../../assets/images/app/play-store.png';

import corporate from '../../assets/images/demo/corporate.png';
import crypto from '../../assets/images/demo/crypto.png';
import shop from '../../assets/images/demo/shop.png';
import portfolio from '../../assets/images/demo/portfolio.png';
import helpCenter from '../../assets/images/demo/help-center.png';
import hosting from '../../assets/images/demo/hosting.png';
import job from '../../assets/images/demo/job.png';
import forums from '../../assets/images/demo/forums.png';
import blog from '../../assets/images/demo/blog.png';
import nft from '../../assets/images/demo/nft.png';
import RightSidebar from './RightSidebar';

// menu
// import { navLinks } from './menu';
// import { MenuItem } from './NavBarComponents';

class Topbar extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isOpen: false,
      dropdownOpenShop: false,
      wishlistModal: false,
      dropdownIsOpen: false,
      open: false,
      position: 'right',
      dropdownOpen: false,
      landing: false,
      components: false,
      demo: false,
      doc: false,
      pages: false,
      company: false,
      account: false,
      email: false,
      blog: false,
      case: false,
      auth: false,
      login: false,
      signup: false,
      reset: false,
      utility: false,
      special: false,
      contact: false,
      multi: false,
      level2: false,
    };
    this.toggleLine = this.toggleLine.bind(this);
    this.toggleDropdownShop.bind(this);
    this.toggleWishlistModal.bind(this);
    this.toggleDropdownIsOpen.bind(this);
    this.toggleRightDrawer = this.toggleRightDrawer.bind(this);
    this.onDrawerClose = this.onDrawerClose.bind(this);
    this.toggleDropdown.bind(this);
    this.togglemodal.bind(this);
  }

  /**
   * Right sidebar drawer
   **/

  toggleRightDrawer = () => {
    this.setState({ position: 'right' });
    this.setState({ open: !this.state.open });
  };
  onDrawerClose = () => {
    this.setState({ open: false });
  };

  toggleWishlistModal = () => {
    this.setState((prevState) => ({
      wishlistModal: !prevState.wishlistModal,
    }));
  };

  toggleDropdownShop = () => {
    this.setState({
      dropdownOpenShop: !this.state.dropdownOpenShop,
    });
  };
  toggleDropdownIsOpen = () => {
    this.setState({
      dropdownIsOpen: !this.state.dropdownIsOpen,
    });
  };

  toggleDropdown = () => {
    this.setState({
      dropdownOpen: !this.state.dropdownOpen,
    });
  };
  togglemodal = () => {
    this.setState((prevState) => ({
      modal: !prevState.modal,
    }));
  };

  toggleLine() {
    this.setState((prevState) => ({ isOpen: !prevState.isOpen }));
  }
  initMenu() {
    this.activateParentDropdown();
  }

  componentDidUpdate(prevProps) {
    if (this.props.type !== prevProps.type) {
      this.initMenu();
    }
  }

  activateParentDropdown() {
    var menuItems = document.getElementsByClassName('sub-menu-item');

    if (menuItems) {
      var matchingMenuItem = null;
      for (var idx = 0; idx < menuItems.length; idx++) {
        if (menuItems[idx].href === window.location.href) {
          matchingMenuItem = menuItems[idx];
        }
      }

      if (matchingMenuItem) {
        matchingMenuItem.classList.add('active');

        const immediateParent = matchingMenuItem.closest('li');
        if (immediateParent) {
          immediateParent.classList.add('active');
        }
        const parent = immediateParent.closest('.parent-menu-item');

        if (parent) {
          parent.classList.add('active');

          var parentMenuitem = parent.querySelector('a');
          if (parentMenuitem) {
            parentMenuitem.classList.add('active');
          }
          var parentOfParent = parent.closest('.parent-parent-menu-item');
          if (parentOfParent) {
            parentOfParent.classList.add('active');
          }
        } else {
          parentOfParent = matchingMenuItem.closest('.parent-parent-menu-item');
          if (parentOfParent) {
            parentOfParent.classList.add('active');
          }
        }
      }
      return false;
    }
    return false;
  }
  componentDidMount() {
    window.scrollTo(0, 0);
    this.initMenu();
  }

  render() {
    return (
      <React.Fragment>
        {this.props.tagline ? this.props.tagline : null}

        <header id="topnav" className="defaultscroll sticky">
          <Container>
            <div>
              {this.props.hasDarkTopBar ? (
                <Link className="logo" to="/">
                  <img
                    src={logodark}
                    height="24"
                    className="logo-light-mode"
                    alt=""
                  />
                  <img
                    src={logolight}
                    height="24"
                    className="logo-dark-mode"
                    alt=""
                  />
                </Link>
              ) : (
                <Link className="logo" to="/">
                  <span className="logo-light-mode">
                    <img src={logodark} className="l-dark" height="24" alt="" />
                    <img
                      src={logolight}
                      className="l-light"
                      height="24"
                      alt=""
                    />
                  </span>
                  <img
                    src={logolight}
                    height="24"
                    className="logo-dark-mode"
                    alt=""
                  />
                </Link>
              )}
            </div>
            <div className="menu-extras">
              <div className="menu-item">
                <Link
                  to="#"
                  onClick={this.toggleLine}
                  className={
                    this.state.isOpen ? 'navbar-toggle open' : 'navbar-toggle'
                  }
                >
                  <div className="lines">
                    <span></span>
                    <span></span>
                    <span></span>
                  </div>
                </Link>
              </div>
            </div>
            {(() => {
              if (this.props.location.pathname === '/index-developer') {
                return <NavbarButtons />;
              } else if (
                this.props.location.pathname === '/index-it-solution-two'
              ) {
                return (
                  <ul className="buy-button list-inline mb-0">
                    <li className="list-inline-item mb-0">
                      <Dropdown
                        isOpen={this.state.dropdownOpen}
                        toggle={this.toggleDropdown}
                      >
                        <DropdownToggle
                          color="none"
                          type="button"
                          className="btn-link text-decoration-none dropdown-toggle p-0 pe-2"
                        >
                          <i className="uil uil-search text-muted"></i>
                        </DropdownToggle>
                        <DropdownMenu
                          end
                          className="dd-menu dropdown-menu-end bg-white shadow rounded border-0 mt-3 py-0"
                          style={{ width: '300px' }}
                        >
                          <div className="search-bar">
                            <Form className="searchform">
                              <input
                                type="text"
                                id="text"
                                name="name"
                                className="form-control border rounded"
                                placeholder="Search..."
                              />
                            </Form>
                          </div>
                        </DropdownMenu>
                      </Dropdown>
                    </li>{' '}
                    <li className="list-inline-item mb-0">
                      <Link to="#" onClick={this.toggleRightDrawer}>
                        <div className="btn btn-icon btn-pills btn-primary settingbtn">
                          <FeatherIcon
                            icon="settings"
                            className="fea icon-sm"
                          />
                        </div>
                      </Link>
                    </li>{' '}
                    <li className="list-inline-item ps-1 mb-0">
                      <Link
                        to="//1.envato.market/landrickreactjs"
                        target="_blank"
                        rel="noreferrer"
                      >
                        <div
                          id="buyButton"
                          className="btn btn-icon btn-pills btn-primary shoppingbtn"
                        >
                          <FeatherIcon
                            icon="shopping-cart"
                            className="fea icon-sm"
                          />
                        </div>
                      </Link>
                    </li>
                  </ul>
                );
              } else if (
                this.props.location.pathname === '/shop-grids' ||
                this.props.location.pathname === '/shop-lists'
              ) {
                return (
                  <ul className="buy-button list-inline mb-0">
                    <li className="list-inline-item mb-0">
                      <Dropdown
                        isOpen={this.state.dropdownOpen}
                        toggle={this.toggleDropdown}
                      >
                        <DropdownToggle
                          direction="right"
                          color="none"
                          type="button"
                          className="btn btn-link text-decoration-none p-0 pe-2"
                        >
                          <i className="mdi mdi-magnify h4 text-muted"></i>
                        </DropdownToggle>
                        <DropdownMenu
                          end
                          className="dd-menu bg-white shadow rounded border-0 mt-3 py-0"
                          style={{ width: '300px' }}
                        >
                          <Form>
                            <input
                              type="text"
                              id="text"
                              name="name"
                              className="form-control border bg-white"
                              placeholder="Search..."
                            />
                          </Form>
                        </DropdownMenu>
                      </Dropdown>
                    </li>
                    <li className="list-inline-item mb-0 pe-1">
                      <Dropdown
                        isOpen={this.state.dropdownOpenShop}
                        toggle={this.toggleDropdownShop}
                      >
                        <DropdownToggle
                          type="button"
                          className="btn btn-icon btn-soft-primary "
                        >
                          <i className="uil uil-shopping-cart align-middle icons"></i>
                        </DropdownToggle>
                        <DropdownMenu
                          direction="left"
                          className="dd-menu bg-white shadow rounded border-0 mt-3 p-4"
                          style={{ width: '300px' }}
                        >
                          <div className="pb-4">
                            <Link to="#" className="media align-items-center">
                              <img
                                src={shop1}
                                className="shadow rounded"
                                style={{ maxWidth: '64px' }}
                                alt=""
                              />
                              <div className="flex-1 text-start ms-3">
                                <h6 className="text-dark mb-0">T-shirt (M)</h6>
                                <p className="text-muted mb-0">$320 X 2</p>
                              </div>
                              <h6 className="text-dark mb-0">$640</h6>
                            </Link>

                            <Link
                              to="#"
                              className="media align-items-center mt-4"
                            >
                              <img
                                src={shop2}
                                className="shadow rounded"
                                alt=""
                                style={{ maxWidth: '64px' }}
                              />
                              <div className="flex-1 text-start ms-3">
                                <h6 className="text-dark mb-0">Bag</h6>
                                <p className="text-muted mb-0">$50 X 5</p>
                              </div>
                              <h6 className="text-dark mb-0">$250</h6>
                            </Link>

                            <Link
                              to="#"
                              className="media align-items-center mt-4"
                            >
                              <img
                                src={shop3}
                                className="shadow rounded"
                                style={{ maxWidth: '64px' }}
                                alt=""
                              />
                              <div className="flex-1 text-start ms-3">
                                <h6 className="text-dark mb-0">Watch (Men)</h6>
                                <p className="text-muted mb-0">$800 X 1</p>
                              </div>
                              <h6 className="text-dark mb-0">$800</h6>
                            </Link>
                          </div>

                          <div className="media align-items-center justify-content-between pt-4 border-top">
                            <h6 className="text-dark mb-0">Total($):</h6>
                            <h6 className="text-dark mb-0">$1690</h6>
                          </div>

                          <div className="mt-3 text-center">
                            <Link to="#" className="btn btn-primary me-2">
                              View Cart
                            </Link>
                            <Link to="#" className="btn btn-primary">
                              Checkout
                            </Link>
                          </div>
                          <p className="text-muted text-start mt-1 mb-0">
                            *T&C Apply
                          </p>
                        </DropdownMenu>
                      </Dropdown>
                    </li>
                    <li className="list-inline-item mb-0 pe-1">
                      <Link
                        to="#"
                        className="btn btn-icon btn-soft-primary"
                        onClick={this.toggleWishlistModal}
                      >
                        <i className="uil uil-heart align-middle icons"></i>
                      </Link>
                    </li>
                    <li className="list-inline-item mb-0">
                      <Dropdown
                        color="primary"
                        isOpen={this.state.dropdownIsOpen}
                        toggle={this.toggleDropdownIsOpen}
                      >
                        <DropdownToggle
                          type="button"
                          className="btn btn-icon btn-soft-primary"
                        >
                          <i className="uil uil-user align-middle icons"></i>
                        </DropdownToggle>
                        <DropdownMenu
                          direction="left"
                          className="dd-menu bg-white shadow rounded border-0 mt-3 py-3"
                          style={{ width: '200px' }}
                        >
                          <Link className="dropdown-item text-dark" to="#">
                            <i className="uil uil-user align-middle me-1"></i>{' '}
                            Account
                          </Link>
                          <Link className="dropdown-item text-dark" to="#">
                            <i className="uil uil-clipboard-notes align-middle me-1"></i>{' '}
                            Order History
                          </Link>
                          <Link className="dropdown-item text-dark" to="#">
                            <i className="uil uil-arrow-circle-down align-middle me-1"></i>{' '}
                            Download
                          </Link>
                          <div className="dropdown-divider my-3 border-top"></div>
                          <Link className="dropdown-item text-dark" to="#">
                            <i className="uil uil-sign-out-alt align-middle me-1"></i>{' '}
                            Logout
                          </Link>
                        </DropdownMenu>
                      </Dropdown>
                    </li>
                  </ul>
                );
              } else if (
                this.props.location.pathname === '/index-apps' ||
                this.props.location.pathname === '/index-classic-app' ||
                this.props.location.pathname === '/index-job'
              ) {
                return (
                  <ul className="buy-button list-inline mb-0">
                    <li className="list-inline-item mb-0">
                      <Link to="#" className="btn btn-icon btn-light">
                        <img
                          src={appStore}
                          className="avatar avatar-ex-small p-1"
                          alt=""
                        />
                      </Link>
                    </li>{' '}
                    <li className="list-inline-item mb-0">
                      <Link to="#" className="btn btn-icon btn-light">
                        <img
                          src={playStore}
                          className="avatar avatar-ex-small p-1"
                          alt=""
                        />
                      </Link>
                    </li>
                  </ul>
                );
              } else {
                return (
                  <ul className="buy-button list-inline mb-0">
                    <li className="list-inline-item mb-0">
                      <Link
                        to="#"
                        onClick={this.toggleRightDrawer}
                        disabled={this.state.open}
                      >
                        <div
                          id="buyButton"
                          className="btn btn-icon btn-pills btn-soft-primary settingbtn"
                        >
                          <FeatherIcon
                            icon="settings"
                            className="fea icon-sm"
                          />
                        </div>
                      </Link>
                    </li>{' '}
                    <li className="list-inline-item ps-1 mb-0">
                      <Link
                        to="//1.envato.market/landrickreactjs"
                        target="_blank"
                        rel="noreferrer"
                      >
                        <div
                          id="buyButton"
                          className="btn btn-icon btn-pills shoppingbtn"
                        >
                          <FeatherIcon
                            icon="shopping-cart"
                            className="fea icon-sm"
                          />
                        </div>
                      </Link>
                    </li>
                  </ul>
                );
              }
            })()}

            <div
              id="navigation"
              style={{ display: this.state.isOpen ? 'block' : 'none' }}
            >
              <ul className="navigation-menu nav-dark" id="top-menu">
                <li>
                  <Link to="/index" className="sub-menu-item">
                    Home
                  </Link>
                </li>
                <li className="has-submenu parent-parent-menu-item">
                  <a href="#about-us">About Us</a>
                </li>

                <li className="has-submenu parent-parent-menu-item">
                  <Link
                    to="#"
                    onClick={() => this.setState({ pages: !this.state.pages })}
                  >
                    Pagess
                  </Link>
                  <span className="menu-arrow"></span>
                  <ul
                    className={classnames('submenu', {
                      open: this.state.pages,
                    })}
                  >
                    <li className="has-submenu parent-menu-item">
                      <Link
                        to="#"
                        onClick={() =>
                          this.setState({ company: !this.state.company })
                        }
                      >
                        {' '}
                        Company{' '}
                      </Link>
                      <span className="submenu-arrow"></span>
                      <ul
                        className={classnames('submenu', {
                          open: this.state.company,
                        })}
                      >
                        <li>
                          <Link to="/page-aboutus" className="sub-menu-item">
                            {' '}
                            About Us
                          </Link>
                        </li>
                        <li>
                          <Link
                            to="/page-aboutus-two"
                            className="sub-menu-item"
                          >
                            {' '}
                            About Us Two{' '}
                          </Link>
                        </li>
                        <li>
                          <Link to="/page-services" className="sub-menu-item">
                            Services
                          </Link>
                        </li>
                        <li>
                          <Link to="/page-history" className="sub-menu-item">
                            History{' '}
                          </Link>
                        </li>
                        <li>
                          <Link to="/page-team" className="sub-menu-item">
                            {' '}
                            Team
                          </Link>
                        </li>
                        <li>
                          <Link to="/page-pricing" className="sub-menu-item">
                            Pricing
                          </Link>
                        </li>
                      </ul>
                    </li>
                    <li className="has-submenu parent-menu-item">
                      <Link
                        to="#"
                        onClick={() =>
                          this.setState({ account: !this.state.account })
                        }
                      >
                        {' '}
                        Account{' '}
                      </Link>
                      <span className="submenu-arrow"></span>
                      <ul
                        className={classnames('submenu', {
                          open: this.state.account,
                        })}
                      >
                        <li>
                          <Link to="/page-profile" className="sub-menu-item">
                            Profile
                          </Link>
                        </li>
                        <li>
                          <Link to="/page-members" className="sub-menu-item">
                            Members{' '}
                          </Link>
                        </li>
                        <li>
                          <Link to="/page-works" className="sub-menu-item">
                            Works{' '}
                          </Link>
                        </li>
                        <li>
                          <Link to="/page-messages" className="sub-menu-item">
                            Messages{' '}
                          </Link>
                        </li>
                        <li>
                          <Link to="/page-chat" className="sub-menu-item">
                            Chat{' '}
                          </Link>
                        </li>
                        <li>
                          <Link to="/page-payments" className="sub-menu-item">
                            Payments{' '}
                          </Link>
                        </li>
                        <li>
                          <Link
                            to="/page-profile-edit"
                            className="sub-menu-item"
                          >
                            Setting
                          </Link>
                        </li>
                        <li>
                          <Link to="/page-invoice" className="sub-menu-item">
                            Invoice
                          </Link>
                        </li>
                      </ul>
                    </li>
                    <li className="has-submenu parent-menu-item">
                      <Link
                        to="#"
                        onClick={() =>
                          this.setState({ email: !this.state.email })
                        }
                      >
                        {' '}
                        Email Template
                      </Link>
                      <span className="submenu-arrow"></span>
                      <ul
                        className={classnames('submenu', {
                          open: this.state.email,
                        })}
                      >
                        <li>
                          <Link
                            to="/email-confirmation"
                            className="sub-menu-item"
                          >
                            Confirmation
                          </Link>
                        </li>
                        <li>
                          <Link
                            to="/email-password-reset"
                            className="sub-menu-item"
                          >
                            Reset Password
                          </Link>
                        </li>
                        <li>
                          <Link to="/email-alert" className="sub-menu-item">
                            Alert
                          </Link>
                        </li>
                        <li>
                          <Link to="/email-invoice" className="sub-menu-item">
                            Invoice
                          </Link>
                        </li>
                      </ul>
                    </li>
                    <li className="has-submenu parent-menu-item">
                      <Link
                        to="#"
                        onClick={() =>
                          this.setState({ blog: !this.state.blog })
                        }
                      >
                        {' '}
                        Blog{' '}
                      </Link>
                      <span className="submenu-arrow"></span>
                      <ul
                        className={classnames('submenu', {
                          open: this.state.blog,
                        })}
                      >
                        <li>
                          <Link to="/page-blog-grid" className="sub-menu-item">
                            Blog Grid
                          </Link>
                        </li>
                        <li>
                          <Link
                            to="/page-blog-sidebar"
                            className="sub-menu-item"
                          >
                            Blog with Sidebar
                          </Link>
                        </li>
                        <li>
                          <Link to="/page-blog-list" className="sub-menu-item">
                            Blog Listing
                          </Link>
                        </li>
                        <li>
                          <Link
                            to="/page-blog-list-sidebar"
                            className="sub-menu-item"
                          >
                            Blog List & Sidebar
                          </Link>
                        </li>
                        <li>
                          <Link
                            to="/page-blog-detail"
                            className="sub-menu-item"
                          >
                            Blog Detail
                          </Link>
                        </li>
                        <li>
                          <Link
                            to="/page-blog-detail-two"
                            className="sub-menu-item"
                          >
                            Blog Detail 2{' '}
                          </Link>
                        </li>
                      </ul>
                    </li>
                    <li className="has-submenu parent-menu-item">
                      <Link
                        to="#"
                        onClick={() =>
                          this.setState({ case: !this.state.case })
                        }
                      >
                        {' '}
                        Case Study{' '}
                      </Link>
                      <span className="submenu-arrow"></span>
                      <ul
                        className={classnames('submenu', {
                          open: this.state.case,
                        })}
                      >
                        <li>
                          <Link to="/page-all-cases" className="sub-menu-item">
                            All Cases{' '}
                          </Link>
                        </li>
                        <li>
                          <Link
                            to="/page-case-detail"
                            className="sub-menu-item"
                          >
                            Case Detail{' '}
                          </Link>
                        </li>
                      </ul>
                    </li>
                    <li>
                      <Link to="/page-course-detail" className="sub-menu-item">
                        Course Detail{' '}
                      </Link>
